GetLastFiveSeasons = system.db.runNamedQuery('WinterShelter/Overview/Get_LastFiveSeasons',{'seasonId':value})
series = []
GetOldSeasonList = system.db.runPrepQuery("SELECT seasonId FROM shelter.Attendance_KPI_PreviousSeason")
OldSeasonList = []
if GetOldSeasonList.getRowCount()>0:
	for r in range(0,GetOldSeasonList.getRowCount()):
		OldSeasonList.append(GetOldSeasonList.getValueAt(r,0))

if GetLastFiveSeasons.getRowCount()>0:
	for i in range(0,GetLastFiveSeasons.getRowCount()):
		seasonId = GetLastFiveSeasons.getValueAt(i,0)
		year = GetLastFiveSeasons.getValueAt(i,1)
		yearLabel = "'" + str(year.split('-')[0])[-2:] + "-'" + str(year.split('-')[1])[-2:]
		data = []
		TotalBeds = 0
		month_list = ['November','December','January','February','March']
		if seasonId in OldSeasonList:
			GetOldTotalBedsData = system.db.runPrepQuery("SELECT * FROM shelter.Attendance_KPI_PreviousSeason where seasonId = "+str(seasonId))
			if GetOldTotalBedsData.getRowCount()>0:
				nov_data = GetOldTotalBedsData.getValueAt(0,'nov_attendance')
				dec_data = GetOldTotalBedsData.getValueAt(0,'dec_attendance')
				jan_data = GetOldTotalBedsData.getValueAt(0,'jan_attendance')
				feb_data = GetOldTotalBedsData.getValueAt(0,'feb_attendance')
				march_data = GetOldTotalBedsData.getValueAt(0,'march_attendance')
				totalBeds = GetOldTotalBedsData.getValueAt(0,'totalBeds')
				data = [{"x": 'NOV', "y": nov_data},
						{"x": 'DEC', "y": nov_data + dec_data},	
						{"x": 'JAN', "y": nov_data + dec_data + jan_data},	
						{"x": 'FEB', "y": nov_data + dec_data + jan_data + feb_data},	
						{"x": 'MAR', "y": totalBeds}]
		else:
			for month in month_list:					
				get_weeklyTotalBeds = system.db.runNamedQuery('WinterShelter/Overview/GetWeeklyTotalBeds_PerSeason',{'seasonId':seasonId,'month':month})
				if get_weeklyTotalBeds.getRowCount()>0:
					for j in range(0,get_weeklyTotalBeds.getRowCount()):
						totalBedsWeekly = get_weeklyTotalBeds.getValueAt(j,'totalBedsWeekly')
						TotalBeds = totalBedsWeekly + TotalBeds
#						if j == 0:
					data.append({
						        "x": (month[0:3]).upper(),
						        "y": TotalBeds
						      })
				else:
					data.append({
						        "x": (month[0:3]).upper(),
						        "y": 0
						      })
		series.append({"data":data,"name":yearLabel})

return series

